import styled from "styled-components";

function CollectionsNav() {
  return (
    <Nav>
      <Button>Most Recent</Button> | <Button>Collections</Button>
      <Button>New Collectable</Button>
    </Nav>
  );
}

const Nav = styled.nav`
  display: flex;
`;

const Button = styled.button`
  font-size: 2.4rem;
  text-transform: uppercase;
  border: none;
  border-radius: none;
  cursor: pointer;
`;

export default CollectionsNav;
